import React, { useState } from 'react';
import { Form } from 'react-bootstrap';
import ButtonBar from './button';
const axios = require('axios');


function Nedbetalingsplan() {
    const [count, setCount] = useState(0);

    function increment() {
        setCount(count + 1);
    }

    function decrement() {
        if (count > 0) {
            setCount(count - 1);
        } else {
            setCount(0)
        }
    }

    function handlePost() {

        const options = {
            method: 'POST',
            url: 'https://visningsrom.stacc.com/dd_server_laaneberegning/rest/laaneberegning/v1/nedbetalingsplan',
            headers: { 'Content-type': 'application/json' },
            data: {
                laanebelop: 2000000,
                nominellRente: 3,
                terminGebyr: 30,
                utlopsDato: "2025-01-01",
                saldoDato: "2020-01-01",
                datoForsteInnbetaling: "2020-02-01",
                ukjentVerdi: "TERMINBELOP"

            }
        }


        axios(options).then(function (response) {
            console.log(response)
            console.log(response.data.nedbetalingsplan)
        }).catch(function (error) {
            console.log(error);
        });

    }



    return (
        <div>
            <Form>
                <Form.Label>Lånebeløp</Form.Label>

                    <button onClick={decrement}>-</button>
                    <input type="text" value={count} onChange={e => setCount(e.target.value)}></input>
                    <button onClick={increment}>+</button>

                    <Form.Label>Lånebeløp</Form.Label>
                    <button onClick={decrement}>-</button>
                    <input type="text" value={count} onChange={e => setCount(e.target.value)}></input>
                    <button onClick={increment}>+</button>

                <div>
                    <button onClick={decrement}>-</button>
                    <input type="text" value={count} onChange={e => setCount(e.target.value)}></input>
                    <button onClick={increment}>+</button>
                </div>
                <div>
                    <button onClick={decrement}>-</button>
                    <input type="text" value={count} onChange={e => setCount(e.target.value)}></input>
                    <button onClick={increment}>+</button>
                </div>
                <div>
                    <button onClick={decrement}>-</button>
                    <input type="text" value={count} onChange={e => setCount(e.target.value)}></input>
                    <button onClick={increment}>+</button>
                </div>
            </Form>
        </div>
    )

}
export default Nedbetalingsplan;
